//import Link from 'next/link';
import Layout from '../components/Layout.js';

export default function Index() {
    return (
        <Layout>
        <div className="divOne">
            <h1>Hello! My name is Cara Spall.</h1>
            <img src="/static/Cara.png" alt="Cara image"/>
            <div className="intro">
            <p>I am a film scholar by education, digital marketer by profession, artist by enthusiasism, and 
                (unsuccessful) web developer by imagination.
            </p>
            </div>


            <style jsx>{`
            .divOne {
                border: solid;
                text-align: center;
                background-color: azure;
            }
            div {
                margin-top: 20px;
                margin-bottom: 20px;
            }
            img {
                height: auto;
                width: 10%;
            }
            a {
                border: solid;
                margin-left: 5px;
                margin-top: 10px;
                background-color: white;
                padding: 5px;
            }
            `}
            </style>
            </div>
    </Layout>
    );
}
